tions of dried specimens. The bill is actually soft, moist and leathery and also highly sensitive. The duck-billed platypus is the most evolutionary distinct mammal alive today.', '', '', 'N', 'N', '', '', ''), ('534', 'Publish', null, null, 'Mammals', 'Other', '359', 'Mammalia', 'Monotremata', 'Tachyglossidae', 'Tachyglossus aculeatus', '', 'Short-beaked echidna', '71.2446531606463', 'LC', '4.28005831955712', 'The name echidna orginates from the Greek goodess Ekhidna who was believed to be half reptile and half mammal, with the face of a woman but the body of a serpent.', 'The name echidna orginates from the Greek goodess Ekhidna who was believed to be half reptile and half mammal, with the face of a woman but the body of a serpent. Echidnas are monotremes. Monotremes differ from all other mammals and resemble reptiles in that they lay shell covered eggs that hatch outside the mother\'s body.', '', '', 'N', 'N', '', '', ''), ('535', 'Publish', null, null, 'Mammals', 'Other', '496', 'Mammalia', 'Xenarthra', 'Myrmecophagidae', 'Cyclopes didactylus', '', 'Silky anteater', '55.2970452923052', 'LC', '4.03064205228186', 'The silky anteater is the world\'s smallest anteater species and is little bigger than a human hand. It is rarely seen due to its small size and its nocturnal (or night-active) and arboreal lifestyle.', 'The silky anteater is the world\'s smallest anteater species and is little bigger than a human hand. It is rarely seen due to its small size and its nocturnal (or night-active) and arboreal lifestyle, and it is even seldom encountered by forest tribes. It has a prehensile tail and long claws for climbing and tearing open ant\'s nests.', '', '', 'N', 'N', '', '', ''), ('536', 'Publish', null, null, 'Mammals', 'Other', '459', 'Mammalia', 'Rodentia', 'Pedetidae', 'Pedetes capensis', '', 'Spring hare', '59.2317261250324', 'LC', '4.09819922553643', 'The spring hare is the only species within the only genus of the family Pedetidae, there are two distinct subpo